(function(){var galeria,availableTags=["Córdoba","Granada","Málaga","Torremolinos, Málaga","Torre del Mar, Málaga","Benálmadena, Málaga","Benidorm, Valencia","Valencia","Alicante","Torrevieja, Alicante","Oropesa del mar, Castellón","Castellón","Alpujarra granadina","Lugo, Galicia","Pozoblanco, Córdoba","Palma del Río, Córdoba","Linares, Jaén","Segovia","Valladolid","Tomelloso, Ciudad Real","Ciudad Real","Badajoz"];function mostrarGaleria(){galeria=this.id.split("-")[2];$("#galeria-casa-"+galeria).fadeIn(200).delay(2e3)}function ocultarGaleria(){galeria=this.id.split("-")[2];$("#galeria-casa-"+galeria).css("display","none")}function showGalery(){$("#fotos-casa-1").on({click:mostrarGaleria});$("#fotos-casa-2").on({click:mostrarGaleria});$("#fotos-casa-3").on({click:mostrarGaleria});$(".galeria-lightbox").on({click:ocultarGaleria})}$(function(){showGalery();$("#destino").autocomplete({source:availableTags})})})();